import React, {Component} from 'react'


class Profil extends Component{
    render(){
      return(
        this.props.coordonee.map((e) =>
          <h1>{e.imgSrc} {e.FullName} {e.bio} {e.profession}</h1>)
      )
    }
  }

export default Profil
